import logo from './logo.svg';
import './App.css';
import Square from './Component/Square';

function App() {
  const handleClick =() => {

  }
  return (
    <div className="App">
     <div className="board">
      <h1 className="title">Let's Play<br/>
        Tic Tac Toe</h1>
       <div className="row">
        <Square 
        chooseSquare={handleClick}
        val={0}/>
        <Square 
        chooseSquare={handleClick}
        val={1}/>
        <Square 
        chooseSquare={handleClick}
        val={2}/>
       </div>
       <div className="row">
       <Square 
        chooseSquare={handleClick}
        val={3}/>
        <Square 
        chooseSquare={handleClick}
        val={4}/>
        <Square 
        chooseSquare={handleClick}
        val={5}/>
       </div>
       <div className="row">
       <Square 
        chooseSquare={handleClick}
        val={6}/>
        <Square 
        chooseSquare={handleClick}
        val={7}/>
        <Square 
        chooseSquare={handleClick}
        val={8}/>
       </div>
     </div>
    </div>
  );
}

export default App;
